import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import Typography from '@material-ui/core/Typography';

import AppBar from '@material-ui/core/AppBar';
import Fab from '@material-ui/core/Fab';
import HomeIcon from '@material-ui/icons/Home';
import Osman from "./diensten/osman/osman.jsx";

import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import purple from '@material-ui/core/colors/purple';
import Button from '@material-ui/core/Button';

const theme = createMuiTheme({
  palette: {
    primary: { main: purple[500] }, // Purple and green play nicely together.
    secondary: { main: '#11cb5f' }, // This is just green.A700 as hex.
  },
  typography: { useNextVariants: true },
});

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: 0 * 3 }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};

const styles = theme => ({
  root: {
    flexGrow: 1,
    maxWidth: '100%',
    maxHight: '100%',
    paddingTop: '70px',
  },
  fabButton: {
    position: 'fixed',
    bottom: theme.spacing.unit * 2,
    right: theme.spacing.unit * 2,
  },
});

class IconLabelTabs extends React.Component {
  state = {
    value: 0,
  };

  handleChange = (event, value) => {
    this.setState({ value });
  };

  render() {
    const { classes } = this.props;
    const { value } = this.state;

    return (
      <div className={classes.root}>
      <AppBar position="fixed" color="paper">
        
        <Tabs
          value={this.state.value}
          onChange={this.handleChange}
          variant="fullWidth"
          indicatorColor="primary"
          textColor="primary"
        >
          <Tab icon={<PersonPinIcon />} label="OSMAN" />
          <Tab icon={<PersonPinIcon />} label="REMCO" />
          <Tab icon={<PersonPinIcon />} label="CENGIZ" />
          <Tab icon={<PersonPinIcon />} label="KUBILAY" />
        </Tabs>
      
      </AppBar>
      {value === 0 && <TabContainer><Osman /></TabContainer>}
      {value === 1 && <TabContainer><Osman /></TabContainer>}
      {value === 2 && <TabContainer><Osman /></TabContainer>}
      {value === 3 && <TabContainer><Osman /></TabContainer>}

      <Fab color="primary" aria-label="Home" className={classes.fabButton}>
            <HomeIcon />
          </Fab>
      </div>
    );
  }
}

IconLabelTabs.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(IconLabelTabs);
